SELECT MAX("probehnuto"."client_id") as agg_0, MAX("client"."client_id") as agg_1 FROM "dobito" LEFT OUTER JOIN "client" ON "dobito"."client_id" = "client"."client_id" LEFT OUTER JOIN "probehnuto" ON "client"."client_id" = "probehnuto"."client_id" LEFT OUTER JOIN "probehnuto_mimo_penezenku" ON "client"."client_id" = "probehnuto_mimo_penezenku"."client_id"  WHERE "probehnuto"."client_id" >= 71332.21076992471 AND "client"."kraj" NOT LIKE '%Středočeský%' AND ("probehnuto_mimo_penezenku"."client_id" >= 27757 OR "probehnuto_mimo_penezenku"."probehla_inzerce_mimo_penezenku" != 'ANO') AND "dobito"."month_year_datum_transakce" NOT LIKE '%2%015-02-01%'